            "asset_id_base_exchange" = ${AssetIdBaseExchange}
            "asset_id_quote_exchange" = ${AssetIdQuoteExchange}
            "price_precision" = ${PricePrecision}
            "size_precision" = ${SizePrecision}
            "raw_kvp" = ${RawKvp}
            "volume_to_usd" = ${VolumeToUsd}
        }

        return $PSO
    }

}

